import React from 'react'

const Input = React.forwardRef(({ ...props }, ref) => {
  return (
    <input
      {...props}
      border='1px solid rgba(40, 40, 70, 0.3)'
      border-radius='10px'
      ref={ref}
    />
  )
})

export default Input
